    value: Reference is made to the May 9, 2008 request from the FEC seeking clarification
      of contributions we received at the end of the first quarter, 2008.  Our review
      of the contributions referenced indicates that a data entry error occurred causing
      the contributions, intended for the General Election, to be coded to the Primary.  The
      confusion was caused by the fact that timely 48 Hour Notices (FEC Form F6) had
      been filed on each of the contributions in advance of the Primary Election causing
      the individual entering the data to mistake them as contributions toward the
      Primary.  This report correctly identifies the contributions as intended by
      the donor, toward the General Election.  No contributions in excess of limits
      have occurred.  Additionally, a procedure to more clearly identify contributions,
      before data entry, has been established by our Committee.
